import React, { Component } from 'react';

class Header extends Component {

  render() {
    let heroTitle = "Kontakta oss";

    return (
      <header className="hero-image contact">
        <div className="hero-text">
          <h1 className="hero-title">
          {heroTitle}
          </h1>
          <button className="todays-menu"> Dagens lunch </button>
        </div>
      </header>

      )
  }
}

export default Header;
